"""### An√°lisis de Entidades Nombradas

Identificar participantes y empresas de un texto.
"""

texto = input("Nombres de los participantes y de que compa√±ia vienes:\n ")

doc = nlp(texto)

personas = [ent.text for ent in doc.ents if ent.label_=="PER"]
empresas = [ent.text for ent in doc.ents if ent.label_=="ORG"]

print(
"\nParticipantes: \n- %s"%"\n- ".join(personas),
"\n\nEmpresa: %s"%", ".join(empresas)
)

