"""### Patrones Basados en Reglas

![image.png](data:image/png;base64,)
"""

# Inicializa con el vocabulario compartido
from spacy.matcher import Matcher
matcher = Matcher(nlp.vocab)

# Los patrones son listas de diccionarios que describen los tokens
pattern = [{"LEMMA": "comer", "POS": "VERB"}, {"LOWER": "pizza"}]
matcher.add("PIZZA", [pattern])

# Los operadores pueden especificar qu√© tan seguido puede
# ser buscado un token
pattern = [{"TEXT": "muy", "OP": "+"}, {"TEXT": "feliz"}]
matcher.add("MUY_FELIZ", [pattern])

# Llamar al matcher sobre un doc devuelve una lista de
# tuples con (match_id, inicio, final)
doc = nlp("Me gusta comer pizza y estoy muy muy feliz")
matches = matcher(doc)
print(matches)

"""### An√°lisis de Sentimientos"""

import pandas as pd

df = pd.read_csv("https://huggingface.co/datasets/beltrewilton/punta-cana-spanish-reviews/resolve/main/punta_cana.csv?download=true")
df = df[:500]
print(df.head())

import spacy

nlp = spacy.load("es_core_news_md")

# Preprocesar el texto: eliminaci√≥n de stopwords y lematizaci√≥n
def preprocess_text(text):
    doc = nlp(text.lower())  # Convertir a min√∫sculas
    tokens = [token.lemma_ for token in doc if not token.is_stop and token.is_alpha]  # Lematizaci√≥n y eliminaci√≥n de stopwords
    return ' '.join(tokens)

# Aplicar preprocesamiento a las rese√±as
df['processed_review'] = df['review_text'].apply(preprocess_text)
print(df['processed_review'].head())

from sklearn.model_selection import train_test_split
from sklearn.feature_extraction.text import CountVectorizer
from sklearn.naive_bayes import MultinomialNB
from sklearn.metrics import accuracy_score, classification_report

# Convertir texto en una representaci√≥n de Bag of Words
vectorizer = CountVectorizer()
X = vectorizer.fit_transform(df['processed_review'])

# Definir las etiquetas (positivo/negativo)
y = df['rating'].apply(lambda x: 1 if x == 5 else 0)

# Dividir el dataset en entrenamiento y prueba
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3, random_state=42)

# Crear y entrenar el modelo Naive Bayes
model = MultinomialNB()
model.fit(X_train, y_train)

# Hacer predicciones
y_pred = model.predict(X_test)

# Evaluar el rendimiento del modelo
accuracy = accuracy_score(y_test, y_pred)
print(f"Precisi√≥n del modelo: {accuracy:.2f}")

import matplotlib.pyplot as plt
from collections import Counter

# Obtener las palabras m√°s comunes en rese√±as positivas
positive_words = ' '.join(df[df['rating'] == 5]['processed_review']).split()
positive_word_counts = Counter(positive_words).most_common(7)

# Visualizar las palabras m√°s comunes
words, counts = zip(*positive_word_counts)
plt.bar(words, counts)
plt.title("Palabras m√°s comunes en rese√±as positivas")
plt.show()